def get_M():
	m = Symbol('m')
	m_w = Symbol('m_w')
	l_com = Symbol('l_com')
	t = Symbol('t')
	I_xx = Symbol('I_xx')
	q1 = Function('q1')
	e = MutableDenseMatrix([[m + m_w, -l_com*m*cos(q1(t))], [-l_com*m*cos(q1(t)), I_xx + l_com**2*m]])
	return e
